		/**** uncomment to use within creative ******/
		
		root.m_cta.on('mouseover' , onRollOver );
		root.m_cta.on('mouseout' , onRollOut ); 
		root.m_cta.on('click' , onClickthroughClicked );
		root.clickthrough.on('click' , onClickthroughClicked );
		
		function onClickthroughClicked()
		{
			window.open( window.clickTag , "_blank" );
		}
		
		root.m_replay.focusBox.visible = false;
		root.m_replay.on('click' , handleReplay );
		root.m_replay.on('mouseover' , handleReplayOver );
		root.m_replay.on('mouseout' , handleReplayOut );
		
		root.m_control.focusBox.visible = false;
		root.m_control.on('click' , handleControl );
		
		function handleControl(e)
		{
			tl.paused(!tl.paused());
			tl.paused() ? root.m_control.gotoAndStop("play") : root.m_control.gotoAndStop("pause");	
		}
		
		function handleReplay(e)
		{
			tl.restart();
			Setup();
			root.m_control.gotoAndStop("pause");
		}
		
		function handleReplayOver(e)
		{
			TweenMax.to(root.m_replay.m_item, .4, {rotation:360});
		}
		
		function handleReplayOut(e)
		{
			TweenMax.to(root.m_replay.m_item, .4, {rotation:0});
		}
		
		function Setup(){
			//root.controlColorWhite = true;
			var hide = [root.m_logo2, root.m_anim1, root.m_anim2, root.m_anim3, root.m_copy1, root.m_copy1b, root.m_copy2, root.m_copy3, root.m_copy4, root.m_copy5, root.m_copy6, root.m_copy7];
			
			TweenMax.set(hide, {alpha: 0});
			root.m_control.visible = true;
			root.m_replay.visible = false;
		}
		
		function playAnim(targetClip, timeScale) {
			var frames = targetClip.totalFrames;
			var duration = frames/24;
			targetClip.gotoAndStop(0);
			
			var tl = new TimelineMax()
			.add("start", 0)
			.to(targetClip, duration, {easel:{frame: frames-1}}, "start")
			.timeScale(timeScale);
			
			return tl;
		}
		
		function hideAnim(targetClip) {
			TweenMax.set(targetClip, {alpha: 0, x: 0});
		}
		
		function textIn(targetText) {
			var tl = new TimelineMax();
			tl.add("start", 0)
			.set(targetText, {alpha: 1}, "start")
			.from(targetText, 0.6, {x: stageWidth, ease:Strong.easeOut}, "start");
			
			return tl;
		}
		
		function textOut(targetText) {
			var tl = new TimelineMax();
			tl.to(targetText, 0.6, {x: -stageWidth, ease:Strong.easeOut});
			
			return tl;
		}
		
		function frame1() {
			// show initial copy
			var tl = new TimelineMax();
			tl.add("start", 0)
			.add(textIn(root.m_copy1), "start")
			.to(root.m_copy1b, 0.6, {alpha: 1}, "start+=1")
			
			return tl;
		}
		
		function frame2() {
			// show copy: pay with points
			var _tl = new TimelineMax();
			_tl.add("start", 0)
			.add(textOut([root.m_copy1, root.m_copy1b]), "start")
			.add(textIn([root.m_copy2, root.m_copy3]), "start+=0.4")
			// play animation clip
			.to(root.m_anim1, 0.1, {alpha: 1}, "start")
			.add(playAnim(root.m_anim1, 1), "start");
			
			return _tl;
		}
		
		function frame3() {
			// show copy: pay at the pump
			var _tl = new TimelineMax();
			_tl.add("start", 0)
			.add(textOut(root.m_copy3), "start")
			.call(hideAnim, [root.m_anim1], this, "start") 
			.add(textIn(root.m_copy4), "start")
			// play animation clip
			.to(root.m_anim2, 0.1, {alpha: 1}, "start")
			.add(playAnim(root.m_anim2, 1), "start");
			
			return _tl;
		}
		
		function frame4() {
			// show copy: on the go
			var _tl = new TimelineMax();
			_tl.add("start", 0)
			.add(textOut(root.m_copy4), "start")
			.call(hideAnim, [root.m_anim2], this, "start") 
			.add(textIn(root.m_copy5), "start")
			// play animation clip
			.to(root.m_anim3, 0.1, {alpha: 1}, "start")
			.add(playAnim(root.m_anim3, 0.75), "start");
			
			return _tl;
		}
		
		var ctaEnd = {
			x: 151,
			y: 667
		};
		
		var logoEnd = {
			x: 230,
			y: 539,
			width: 378,
			height: 129
		};
		
		
		function frame5() {
			var tl = new TimelineMax();
			tl.add("start", 0)
			// hide stuff
			.call(hideAnim, [root.m_anim3], this, "start") 
			.to([root.m_copy2, root.m_copy5, root.m_cta, root.m_logo], 0.4, {alpha: 0}, "start")
			
			// set position of logo and cta for endframe
			.set(root.m_cta, {x: ctaEnd.x, y: ctaEnd.y}, "start+=0.4")
			//.set(root.m_logo, {x: logoEnd.x, y: logoEnd.y, width: logoEnd.width, height:logoEnd.height}, "start+=0.4")
			.set(root.m_logo, {alpha: 0}, "start+=0.4")
			// show end copy and logo lockup
			.to([root.m_copy6, root.m_copy7, root.m_logo2], 0.4, {alpha: 1}, "start+=0.6")
			
			// show cta
			.to(root.m_cta, 0.4, {alpha: 1}, "start+=1");
			
			return tl;
		}
		
		
		
		this.onInit = function()
		{
			Setup();
			tl = new TimelineMax();
			
			tl.add("frame01", 0.3)
			.add(frame1(), "frame01")
			
			.add("frame02", "+=2.5")
			.add(frame2(), "frame02")
				
			.add("frame03" , "-=0.5")
			.add(frame3(), "frame03")
			
			.add("frame04", "-=3")
			.add(frame4(), "frame04")
			
			.add("frame05", "-=4")
			.add(frame5(), "frame05");
			
		
			tl.addCallback(endFrame);
			
			//tl.duration(15);
		}
		
		
		function switchControlColor(){
			root.controlColorWhite = true;
		}
		
		function endFrame(){
			root.m_control.visible = false;
			root.m_replay.visible = true;
			//console.log(tl.duration())
			console.log('ends at: ' + tl.endTime());
		}
		
		
		/**** ADA Keyboard Focus Code *******************/
		
		this.totalFocusElements = 2;
		this.currentFocusElement = 0;
		
		this.focusNextElement = function()
		{
			root.currentFocusElement++;
			
			if( !root.m_cta.visible || root.m_cta.alpha == 0 && root.currentFocusElement == 1 ) return false;
				
			root.m_control.focusBox.visible = root.m_replay.focusBox.visible = ( root.currentFocusElement == 0 );
			root.m_cta.focusBox.visible = ( root.currentFocusElement == 1 );
			
			return true;
		}
		
		this.setTabFocus = function()
		{
			root.m_control.focusBox.visible = root.m_replay.focusBox.visible = ( root.currentFocusElement == 0 );
			root.m_cta.focusBox.visible = ( root.currentFocusElement == 1 );
		}
		
		this.removeTabFocus = function()
		{
			root.m_control.focusBox.visible = root.m_replay.focusBox.visible = false;
			root.m_cta.focusBox.visible = false;
		}
		
